import React from "react";
import Login from "./Login.jsx";
import LoginData from "../LoginData.js";


function RestaurantAndCustomerLogin () {
  return (
    <div>
      <Login
      href={LoginData[0].href}
      pageName={LoginData[0].pageName}
      />
      <Login
      href={LoginData[1].href}
      pageName={LoginData[1].pageName}
      />
    </div>
  );
}

export default RestaurantAndCustomerLogin;
